import React, { useState, useEffect } from "react";

const hospitalData = [
  {
    "name": "ABC Hospital",
    "address": "123 Main St",
    "phone": "99XXXX99XX",
    "type": "Hospital",
    "image": "hospital1.jpg",
    "rating": 4.5
  },
  {
    "name": "ABC Clinic",
    "address": "456 Oak St",
    "phone": "99XXXX99XX",
    "type": "Clinic",
    "image": "clinic1.jpg",
    "rating": 3.8
  },
  {
    "name": "XYZ Hospital",
    "address": "789 Pine St",
    "phone": "88XXXX88XX",
    "type": "Hospital",
    "image": "hospital2.jpg",
    "rating": 4.0
  },
  {
    "name": "XYZ Clinic",
    "address": "101 Maple St",
    "phone": "88XXXX88XX",
    "type": "Clinic",
    "image": "clinic2.jpg",
    "rating": 4.2
  }
];

const HospitalClinicList = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    setData(hospitalData);
  }, []);

  return (
    <div className="p-6">
      <div className="mb-6">
        <h2 className="text-2xl font-bold text-white mb-4">Hospitals Nearby</h2>
        <div className="grid grid-cols-2 h-40 gap-4">
          {data
            .filter(item => item.type === "Hospital")
            .map((hospital, index) => (
              <div key={index} className="relative flex bg-custombg rounded-lg">
                <div className="w-1/3 bg-gray-300 rounded-lg">
                  <img
                    src={hospital.image}
                    alt={hospital.name}
                    className="w-full h-full object-cover rounded-lg"
                  />
                </div>
                <div className="w-2/3 pt-4 pl-4 text-white relative">
                  <h3 className="font-bold text-xl">{hospital.name}</h3>
                  <p className="text-lg">{hospital.address}</p>
                  <p className="text-lg">Ph. No.: {hospital.phone}</p>
                  <div className="absolute bottom-2 right-2 text-lg text-white">
                    {hospital.rating} ★
                  </div>
                </div>
              </div>
            ))}
        </div>
      </div>

      <div className="mb-6">
        <h2 className="text-2xl text-white font-bold mb-4">Clinics Nearby</h2>
        <div className="grid grid-cols-2 h-40 gap-4">
          {data
            .filter(item => item.type === "Clinic")
            .map((clinic, index) => (
              <div key={index} className="relative flex bg-custombg rounded-lg">
                <div className="w-1/3 bg-gray-300 rounded-lg">
                  <img
                    src={clinic.image}
                    alt={clinic.name}
                    className="w-full h-full object-cover rounded-lg"
                  />
                </div>
                <div className="w-2/3 pt-4 pl-4 text-white relative">
                  <h3 className="font-bold text-xl">{clinic.name}</h3>
                  <p className="text-lg">{clinic.address}</p>
                  <p className="text-lg">Ph. No.: {clinic.phone}</p>
                  <div className="absolute bottom-2 right-2 text-sm text-yellow-400">
                    {clinic.rating} ★
                  </div>
                </div>
              </div>
            ))}
        </div>
      </div>
    </div>
  );
};

export default HospitalClinicList;
